import React, { useState } from 'react';
import { generateCSV, downloadFile } from '../../utils/helpers';
import { getRiskCategoryInfo } from '../../utils/helpers';

const BatchResults = ({ result }) => {
  const [expandedRow, setExpandedRow] = useState(null);
  
  const toggleRow = (index) => {
    setExpandedRow(expandedRow === index ? null : index);
  };
  
  const downloadResults = () => {
    const headers = [
      { key: 'row_id', label: 'Row ID' },
      { key: 'risk_percentage', label: 'Risk Percentage' },
      { key: 'risk_category', label: 'Risk Category' },
      ...Object.keys(result.results[0].features_used).map(key => ({
        key: `features_used.${key}`,
        label: key
      }))
    ];
    
    const data = result.results.map(res => ({
      ...res,
      ...res.features_used
    }));
    
    const csvContent = generateCSV(data, headers);
    downloadFile(csvContent, `batch-results-${result.batch_id}.csv`);
  };
  
  return (
    <div className="bg-white rounded-xl shadow-lg overflow-hidden">
      <div className="p-6 border-b">
        <div className="flex justify-between items-center">
          <div>
            <h2 className="text-xl font-bold text-gray-900">Batch Prediction Results</h2>
            <p className="text-gray-600">
              {result.filename} - {result.total_records} records
            </p>
          </div>
          <button 
            onClick={downloadResults}
            className="px-4 py-2 bg-gradient-to-r from-primary-600 to-primary-500 text-white rounded-lg hover:from-primary-700 hover:to-primary-600"
          >
            Download CSV
          </button>
        </div>
        
        <div className="mt-4 grid grid-cols-4 gap-4">
          <div className="bg-green-50 border border-green-200 rounded-lg p-3 text-center">
            <div className="text-2xl font-bold text-green-700">{result.successful_predictions}</div>
            <div className="text-sm text-green-600">Successful</div>
          </div>
          <div className="bg-red-50 border border-red-200 rounded-lg p-3 text-center">
            <div className="text-2xl font-bold text-red-700">{result.failed_predictions}</div>
            <div className="text-sm text-red-600">Failed</div>
          </div>
          <div className="bg-blue-50 border border-blue-200 rounded-lg p-3 text-center">
            <div className="text-2xl font-bold text-blue-700">{result.total_records}</div>
            <div className="text-sm text-blue-600">Total Records</div>
          </div>
          <div className="bg-yellow-50 border border-yellow-200 rounded-lg p-3 text-center">
            <div className="text-2xl font-bold text-yellow-700">
              {Math.round((result.successful_predictions / result.total_records) * 100)}%
            </div>
            <div className="text-sm text-yellow-600">Success Rate</div>
          </div>
        </div>
      </div>
      
      <div className="overflow-x-auto">
        <table className="min-w-full divide-y divide-gray-200">
          <thead className="bg-gray-50">
            <tr>
              <th scope="col" className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                Row ID
              </th>
              <th scope="col" className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                Risk
              </th>
              <th scope="col" className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                Category
              </th>
              <th scope="col" className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                Status
              </th>
              <th scope="col" className="relative px-6 py-3">
                <span className="sr-only">Actions</span>
              </th>
            </tr>
          </thead>
          <tbody className="bg-white divide-y divide-gray-200">
            {result.results.slice(0, 10).map((row, index) => {
              const categoryInfo = getRiskCategoryInfo(row.risk_category);
              return (
                <React.Fragment key={index}>
                  <tr 
                    className="hover:bg-gray-50 cursor-pointer"
                    onClick={() => toggleRow(index)}
                  >
                    <td className="px-6 py-4 whitespace-nowrap text-sm font-medium text-gray-900">
                      {row.row_id}
                    </td>
                    <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-500">
                      {row.risk_percentage || 'N/A'}%
                    </td>
                    <td className="px-6 py-4 whitespace-nowrap text-sm">
                      {row.risk_category ? (
                        <span className={`inline-flex items-center px-2.5 py-0.5 rounded-full text-xs font-medium ${categoryInfo.bgColor} ${categoryInfo.color}`}>
                          {categoryInfo.label}
                        </span>
                      ) : (
                        <span className="inline-flex items-center px-2.5 py-0.5 rounded-full text-xs font-medium bg-gray-100 text-gray-800">
                          Error
                        </span>
                      )}
                    </td>
                    <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-500">
                      {row.error ? (
                        <span className="text-red-600">Failed</span>
                      ) : (
                        <span className="text-green-600">Success</span>
                      )}
                    </td>
                    <td className="px-6 py-4 whitespace-nowrap text-right text-sm font-medium">
                      <button className="text-primary-600 hover:text-primary-900">
                        {expandedRow === index ? 'Hide' : 'View'}
                      </button>
                    </td>
                  </tr>
                  {expandedRow === index && (
                    <tr>
                      <td colSpan="5" className="px-6 py-4 bg-gray-50">
                        <div className="grid grid-cols-2 gap-4">
                          {row.error ? (
                            <div className="col-span-2">
                              <h4 className="text-sm font-medium text-gray-900 mb-2">Error Details</h4>
                              <div className="bg-red-50 border border-red-100 rounded-lg p-3 text-red-700">
                                {row.error}
                              </div>
                            </div>
                          ) : (
                            <>
                              <div>
                                <h4 className="text-sm font-medium text-gray-900 mb-2">Features</h4>
                                <ul className="space-y-1">
                                  {Object.entries(row.features_used).map(([key, value]) => (
                                    <li key={key} className="flex justify-between">
                                      <span className="text-gray-600 capitalize">{key}:</span>
                                      <span className="font-medium">{value}</span>
                                    </li>
                                  ))}
                                </ul>
                              </div>
                              <div>
                                <h4 className="text-sm font-medium text-gray-900 mb-2">Advice</h4>
                                <div className="bg-blue-50 border border-blue-100 rounded-lg p-3">
                                  <p className="text-gray-700">{row.personalized_advice}</p>
                                </div>
                              </div>
                            </>
                          )}
                        </div>
                      </td>
                    </tr>
                  )}
                </React.Fragment>
              );
            })}
          </tbody>
        </table>
      </div>
      
      <div className="bg-gray-50 px-6 py-4 text-center">
        <p className="text-sm text-gray-500">
          Showing 10 of {result.total_records} results
        </p>
      </div>
    </div>
  );
};

export default BatchResults;
